class App extends React.Component {
  constructor () {
    super()
    this.state = {
      toggle: true,
      val: 'On'
    }
  }

  render () {
    return (
      <>
        <div>Toggle {this.state.val}</div>
        <button onClick={() => handleToggle()}>Toggle</button>
      </>
    )
  }
}

export default App
